import React, { Component } from 'react';
import Banner from '../components/Banner';
import { Header } from '../components/Header';
import { HomeWrapper } from '../styles/routes/HomeStyle';

class Home extends Component {
    render(){
        return(
            <HomeWrapper>
                <Header />
                <Banner />
            </HomeWrapper>
        )
    }
}

export default Home;
